# %%
d = ""

MARKER_LEN_1 = 4
MARKER_LEN_2 = 14


def find_marker_pos(marker_len, d=d):
    for i in range(len(d) - marker_len + 1):
        if len(set(d[i : i + marker_len])) == marker_len:
            return i + marker_len
    return -1


p1_res = find_marker_pos(MARKER_LEN_1)
p2_res = find_marker_pos(MARKER_LEN_2)
print(p1_res)
print(p2_res)
